INSERT INTO `module_lists` (`id`,`module_name`,`table_name`,`summarry`,`description`,`created_on`,`created_by`) VALUES 
 (1,'locations_add','locations','All information related to various locations in the company.','\r\n<ul><li><span style=\"font-weight: bold;\">&nbsp;Location :</span> branches of \r\ncompany</li></ul>\r\n<ul><li><span style=\"font-weight: bold;\">&nbsp;Parent Location :</span> Head \r\noffice or main branch of company.</li></ul>\r\n<ul><li><span style=\"font-weight: bold;\">&nbsp;Address 1 : </span>address of \r\ncompany &nbsp;</li></ul>\r\n<ul><li><span style=\"font-weight: bold;\">&nbsp;Address 2 </span>:address of \r\ncompany. &nbsp;</li></ul>\r\n<ul><li>&nbsp;<span style=\"font-weight: bold;\">Country :</span> name of \r\ncountry in which office is located</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;State :</span>name of state in which office \r\nis located</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;City :</span>name\r\n of city in which office is located</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Phone : </span>phone numbers of office.</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Email : </span>Email address of company \r\nlocation</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Website </span>:\r\n website address of company</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Details :</span> Details of company</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Postal Code :</span> postal code</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Fax : </span>fax number</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Gps Location </span>: GPS location of \r\ncompany</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Allowed IPs :</span>\r\n allowed IPs</li></ul><ul><li>&nbsp;<span style=\"font-weight: bold;\">Attention\r\n :</span>Attention</li></ul><ul><li><span style=\"font-weight: bold;\">Active\r\n : </span>set whether active or not &nbsp;</li></ul>\r\n','2010-05-05 00:00:00','admin@bioenabletech.com'),
 (3,'workspaces_add','workspaces','all information related to work spaces in company.','\r\n<ul><li>&nbsp;<span style=\"font-weight: bold;\"> Photo : </span>actual photo \r\ngraph of workspace.</li></ul><ul><li>&nbsp;<span style=\"font-weight: bold;\"> \r\nWorkspace Name : </span>name of workspace.</li></ul><ul><li><span style=\"font-weight: bold;\">&nbsp;Description : </span>details of workspace</li></ul><ul><li>&nbsp;<span style=\"font-weight: bold;\">Location :</span>location of workspace.</li></ul><ul><li>&nbsp;<span style=\"font-weight: bold;\">Department (if required) : </span>name of \r\ndepartment related to workspace. </li></ul><ul><li>&nbsp;<span style=\"font-weight: bold;\">Designation (if specially created): </span>designation\r\n specification for which workspace created.&nbsp;</li></ul>\r\n\r\n\r\n\r\n','2010-05-04 00:00:00','admin@bioenabletech.com'),
 (2,'company_add','company','All information related to company.','\r\n<ul><li>&nbsp;\r\n\r\n\r\n\r\n   <span style=\"font-weight: bold;\"><span style=\"text-decoration: underline;\">Company Name     :</span> </span>name of your company.</li></ul><ul><li><span style=\"font-weight: bold; text-decoration: underline;\">Logo            \r\n          : </span>Upload logo of your company\r\n   </li></ul><ul><li><span style=\"font-weight: bold;\"><span style=\"text-decoration: underline;\">&nbsp;Billing Location     :</span> </span>A\r\n location where your company\r\n</li></ul>   <ul><li><span style=\"font-weight: bold; text-decoration: underline;\">Shipping Location  :&nbsp;\r\n</span>A global delivery center of compoany</li></ul><ul><li>&nbsp;   <span style=\"font-weight: bold; text-decoration: underline;\">Website(http://...)\r\n   :</span> Web URL of your Company\r\n   </li></ul><ul><li><span style=\"font-weight: bold;\"><span style=\"text-decoration: underline;\">Display Logo          :</span> </span>Do\r\n you want to display logo of your company?\r\n   </li></ul><ul><li><span style=\"font-weight: bold; text-decoration: underline;\">First Fiscal Month  :</span> you can set your first month of\r\n fiscal year\r\n</li></ul><ul><li>&nbsp;   <span style=\"font-weight: bold; text-decoration: underline;\">Default Currency    : </span>Default currency that you are \r\nusing\r\n   </li></ul><ul><li><img src=\"file:///C:/DOCUME%7E1/Owner/LOCALS%7E1/Temp/moz-screenshot.png\" alt=\"\"><span style=\"font-weight: bold; text-decoration: underline;\">Default\r\n time zone</span> : Default \r\ntime zone of your country.\r\n\r\n\r\n\r\n</li></ul>\r\n','2010-05-04 00:00:00','admin@bioenabletech.com'),
 (4,'organization_chart_view','organization_chart','it displays all information about employees like A department head and employee working under him also some imp things like Employee,Designation Name,Department etc. ','\r\n<span style=\"font-weight: bold; text-decoration: underline;\">Supervisor Name 	:</span> name of Supervisor\r\n<span style=\"font-weight: bold; text-decoration: underline;\">Employee No 	        : </span>Id number of employee.\r\n<span style=\"font-weight: bold; text-decoration: underline;\">Employee 	: </span>Name of employee\r\n<span style=\"font-weight: bold; text-decoration: underline;\">Designation Name 	:</span> designation of employee\r\n<span style=\"font-weight: bold; text-decoration: underline;\">Department 	:</span>        Name of department of company.\r\n<span style=\"font-weight: bold; text-decoration: underline;\">Head Name 	:</span>        name of head of employee.\r\n<span style=\"font-weight: bold; text-decoration: underline;\">Gender 	        : </span>gender of employee.<span style=\"font-weight: bold; text-decoration: underline;\">\r\nMobile 	        :</span> Mobile number of employee\r\nEmail 	        : Email of employee\r\nJoining Date       :Joining date of employee\r\n','2010-05-04 09:02:45','admin@bioenabletech.com'),
 (5,'company_policies_add','Company Policies','This Module will guide about all policies of companies.','<ul><li><span style=\"font-weight: bold;\">\r\nSection  : here you can select section as HR, RnD,general,account    ,sales,service     ,support,other etc. <br></span></li><li><span style=\"font-weight: bold;\">Title 	: Title of policy</span></li><li><span style=\"font-weight: bold;\">&nbsp;Statement 	: statement of policy <br></span></li><li><span style=\"font-weight: bold;\">Description 	: description of the policy and all issues related to it.</span></li><li><span style=\"font-weight: bold;\">Document 	: attached document if any. <br></span></li><li><span style=\"font-weight: bold;\">Department Id 	: related department id. <br></span></li><li><span style=\"font-weight: bold;\">Priority Id 	: priority of policy as normal ,important, critical, special</span></li><li><span style=\"font-weight: bold;\">Location Id 	: Location of policy defined.\r\n\r\n</span></li></ul>','2010-05-03 00:00:00','admin@bioenabletech.com'),
 (6,'divisions_add','Divisions','Various divisions exists in the company with their description and head of that division.','\r\n\r\n\r\n<ul><li><span style=\"font-weight: bold;\">Division Name: </span>Name of \r\ndivision<span style=\"font-weight: bold;\"></span></li><li><span style=\"font-weight: bold;\">Division Code 	:</span> code for the division.</li><li><span style=\"font-weight: bold;\">Description 	</span>:\r\n detail information of that division about their  role in company etc.</li><li><span style=\"font-weight: bold;\">Division Head: </span>Head of division.\r\n</li></ul>\r\n\r\n','2010-05-03 00:00:00','admin@bioenabletech.com'),
 (7,'departments_add','Departments','This module will introduce you to various departments in the company.','\r\n\r\n\r\n<ul><li><span style=\"font-weight: bold;\">Name:</span>name of the \r\ndepartment 	\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Head 	:</span> name \r\nof head of the department.\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Group Email : </span>Email\r\n address for the department.\r\n\r\n</li></ul>\r\n','2010-05-03 00:00:00','admin@bioenabletech.com'),
 (8,'designation_levels_add',' Designation Levels','This module will introduce you to all various destinations exists in company with their ids and ranks.','\r\n\r\n<ul><li><span style=\"font-weight: bold;\">Id 	: </span>Id of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Level Name 	: </span>name\r\n of post of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Description 	: </span>role\r\n of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Rank : </span>rank of\r\n employee \r\n</li></ul>\r\n','2010-05-03 00:00:00','admin@bioenabletech.com'),
 (9,'designation_add','designations','This will explain you to about Designation ,Short name ,Related Department, 	Supervisor designation ,Level and Rank 	.','\r\n\r\n\r\n\r\n\r\n<ul><li><span style=\"font-weight: bold;\">Designation 	:</span>designation\r\n of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Shortname 	:</span>short\r\n name for the designation.\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Related Department 	:</span>\r\n department related to designation\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Supervisor \r\ndesignation 	: </span>designation of supervisor\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Level 	:</span>level \r\nof employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Rank : </span>rank of\r\n employee.\r\n\r\n\r\n\r\n</li></ul>\r\n','2010-04-30 00:00:00','admin@bioenabletech.com'),
 (10,'job_positions_add','Job Positions','This module tells you about Job Code ,Position Name,Designation ,Description of employee.','\r\n\r\n<ul><li><span style=\"font-weight: bold;\">Job Code  	:</span> code for \r\nthe particular post\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Position Name 	:</span>\r\n Name of position\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Designation: </span> \r\n	designation name\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Description: </span>job\r\n description \r\n</li></ul>\r\n','2010-04-30 00:00:00','admin@bioenabletech.com'),
 (11,'job_roles_add','Job Roles','this module will tell you about Level,Job Code,Job Role name,Parent role,Priority,Status,Description','\r\n\r\n\r\n<ul><li><span style=\"font-weight: bold;\">Level  	: </span>rank of employee (should be a number)\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Job Code 	: </span>code\r\n for the post\r\nJob </li></ul><ul><li><span style=\"font-weight: bold;\">Role name 	: </span>Name\r\n of post\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Parent role 	: </span>supervisor\r\n role\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Priority 	 :</span> \r\npriority of employee role.\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Status 	:</span>Status\r\n of employee.\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Description:</span>role\r\n of employee.\r\n</li></ul>\r\n\r\n','2010-04-30 00:00:00','admin@bioenabletech.com'),
 (12,'employees_add','employees','this module displays information of employee.','\r\n\r\n\r\n<ul><li><span style=\"font-weight: bold;\">Employee No  	:</span> number \r\nof employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">First Name 	: </span>first\r\n name of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Middle </span><span style=\"font-weight: bold;\">Name: </span>name of father/husband 	\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Last Name 	: </span>surname\r\n of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Email 	:</span>email \r\nid of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Password 	: </span>passwords\r\n of employee.\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Department Id 	:</span>\r\n id of department\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Division 	: </span>various\r\n divisions in company.\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Designation 	:</span>designation\r\n of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Supervisor 	</span>: \r\nname of supervisor\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Location 	:</span> \r\nworking location of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Workspace 	:</span>workspace\r\n of employee</li></ul><ul><li><span style=\"font-weight: bold;\">Group Id \r\n	: </span>group id of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Introduction 	: </span>A\r\n brief introduction of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Photo 	: </span>photograph\r\n of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Work Phone 	:</span>work\r\n phone number\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Work Phone Ext 	: </span>extension\r\n number of work phone\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Fax Phone 	:</span> \r\nfax number\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Current Address 	:</span>current\r\n address of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Current Address2 :</span>current\r\n address of employee	\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Current Country 	 :</span>current\r\n country\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Current City 	:</span>current\r\n city\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Current State 	:</span>current\r\n state\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Current Postal Code 	:</span>postal\r\n code\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Mobile 	:</span>mobile\r\n number of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Job Code 	:</span>job\r\n code of employee\r\n</li></ul><ul><li><span style=\"font-weight: bold;\">Employment Status 	:</span>emplacement\r\n stats of employee\r\n\r\n</li></ul>\r\n','2010-04-30 00:00:00','admin@bioenabletech.com'),
 (13,'employee_privledges_edit',' Employee Privileges','This module explains about  Employee Privileges','\r\n<ul><li><span style=\"font-weight: bold;\">Employee No.:</span>enter employee number</li></ul><ul><li><span style=\"font-weight: bold;\">First Name:</span>enter first name of employee</li></ul><ul><li><span style=\"font-weight: bold;\">Last Name:</span>enter last name of employee</li></ul><ul><li><span style=\"font-weight: bold;\">Email:</span>enter email</li></ul><ul><li><span style=\"font-weight: bold;\">Department</span>:give department name</li></ul><ul><li><span style=\"font-weight: bold;\">Password:</span>enter password for employee</li></ul><ul><li><span style=\"font-weight: bold;\">Designation:</span>enter designation</li></ul><ul><li><span style=\"font-weight: bold;\">Date of Birth:</span>enter date of birth</li></ul><ul><li><span style=\"font-weight: bold;\">Joining Date</span>:enter joining date</li></ul><ul><li><span style=\"font-weight: bold;\">Leaves Review Date</span>:enter leave review date</li></ul><ul><li><span style=\"font-weight: bold;\">Employment Status</span>:enter employment status<br></li></ul><ul><li><span style=\"font-weight: bold;\">Max. Leaves Allowed:</span>enter maximum leaves allowed to that employee</li></ul><ul><li><span style=\"font-weight: bold;\">Supervisor:</span>enter supervisor name</li></ul><ul><li><span style=\"font-weight: bold;\">Pan No</span>:enter pan number</li></ul><ul><li><span style=\"font-weight: bold;\">Workspace:</span>give workspace name of that employee</li></ul><ul><li><span style=\"font-weight: bold;\">Job Code:</span>enter job code</li></ul><ul><li><span style=\"font-weight: bold;\">Shift Default:</span>enter default shift</li></ul><ul><li><span style=\"font-weight: bold;\">Active Login :</span>select or unselected</li></ul><ul><li><span style=\"font-weight: bold;\">Doc1(Photo ID Proof):</span>add document </li></ul><ul><li><span style=\"font-weight: bold;\">Doc2(Address/Other Proof):</span>add address proof</li></ul><ul><li><span style=\"font-weight: bold;\">Doc3(Educational 1):</span>add educational proof</li></ul><ul><li><span style=\"font-weight: bold;\">Doc4(Educational 2):</span>add educational proof</li></ul><ul><li><span style=\"font-weight: bold;\">Privileged by:</span>enter name of privileged provider</li></ul><br><br><br><br><br><br><br><br>\r\n','2010-04-30 00:00:00','admin@bioenabletech.com'),
