 (45,'leaves_edit','leaves','Edit your leaves record here','\r\n<ul><li><span style=\"font-weight: bold;\">Employee :</span> Name of employee</li></ul><ul><li><span style=\"font-weight: bold;\">From Date: </span>date from leave needed</li></ul><ul><li><span style=\"font-weight: bold;\">To Date </span>: date to leave needed</li></ul><ul><li><span style=\"font-weight: bold;\">Duration(in Days excl. Holidays, 0.5=Half Day) :</span> total number of days </li></ul><ul><li><span style=\"font-weight: bold;\">Priority :</span> priority of leave</li></ul><ul><li><span style=\"font-weight: bold;\">Leaves Type :</span> leave type</li></ul><ul><li><span style=\"font-weight: bold;\">Session(only for Halfday leaves) :</span> mention session of day</li></ul><ul><li><span style=\"font-weight: bold;\">Title:</span> title of record</li></ul><ul><li><span style=\"font-weight: bold;\">Message:</span> details of record</li></ul><ul><li><span style=\"font-weight: bold;\">Created On: </span>date on which record created</li></ul><ul><li><span style=\"font-weight: bold;\">Requested by:</span> leave requested by</li></ul>','2010-05-12 00:00:00','admin@bioenabletech.com');
