    INSERT INTO attendance_logs_bulk_entry_report (Recorddate,WorkID,timeAsPerShftTimings, shift) SELECT DATE_FORMAT(dateStart, '%e-%c-%Y'),employeeId,'leave', shiftId FROM attendance_logs_bulk_entry_report WHERE NOT EXISTS (SELECT * FROM attendance_logs_bulk_entry_report WHERE Recorddate=DATE_FORMAT(dateStart, '%e-%c-%Y') AND WorkID=employeeId AND shift=shiftId) and weekends not like CONCAT('%', DAYOFWEEK(dateStart) ,'%') LIMIT 1;
    INSERT INTO attendance_logs_bulk_entry_report (Recorddate,WorkID,timeAsPerShftTimings, shift) SELECT DATE_FORMAT(mainDateStart, '%e-%c-%Y'),employeeId,'Absent', shiftId FROM attendance_logs_bulk_entry_report WHERE NOT EXISTS (SELECT * FROM attendance_logs_bulk_entry_report WHERE Recorddate=DATE_FORMAT(mainDateStart, '%e-%c-%Y') AND WorkID=employeeId AND shift=shiftId) and weekends not like CONCAT('%', DAYOFWEEK(mainDateStart) ,'%') LIMIT 1 ;
