DROP TRIGGER /*!50030 IF EXISTS */ `TimeCard_before_update`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `TimeCard_before_update` BEFORE UPDATE ON `attendance_timecard` FOR EACH ROW BEGIN	
	
SET @shifttime ='';
SET @lunchtime ='';
SET @shiftid=NULL;
SET @shiftname= '';
SET @shiftstart= '';
SET @shiftEnd= '';	
SET @FirstPunch=new.FirstPunch;
SET @SecondPunch=new.SecondPunch;
SET @ThirdPunch=new.ThirdPunch;
SET @FourthPunch=new.FourthPunch;
SELECT COUNT(*)INTO  @ovnight FROM calcalendar WHERE employee=(SELECT employee_id  FROM employees WHERE employee_no=new.WorkID LIMIT 1) AND DateField=new.Recorddate LIMIT 1;	
IF(@ovnight>0) THEN 
SELECT overnight INTO @overnight FROM calcalendar WHERE employee=(SELECT employee_id  FROM employees WHERE employee_no=new.WorkID LIMIT 1) AND DateField=new.Recorddate LIMIT 1;	
	END IF;
		
	IF(@overnight<>1)THEN
	SET @overnight=0;
	END IF;
	
IF(@overnight=1)THEN
IF(new.FourthPunch<new.FirstPunch) THEN
	SET @FirstPunch=CONCAT_WS(' ',new.Recorddate,new.FirstPunch);
	SET @FourthPunch=CONCAT_WS(' ',DATE(DATE_ADD(new.Recorddate,INTERVAL 1 DAY)),new.FourthPunch);
END IF;
IF(new.FourthPunch<new.SecondPunch) THEN
SET @SecondPunch=CONCAT_WS(' ',new.Recorddate,new.SecondPunch);
ELSE
SET @SecondPunch=CONCAT_WS(' ',DATE(DATE_ADD(new.Recorddate,INTERVAL 1 DAY)),new.SecondPunch);
END IF;
	
IF(new.FourthPunch<new.ThirdPunch) THEN
SET @ThirdPunch=CONCAT_WS(' ',new.Recorddate,new.ThirdPunch);	
ELSE
SET @ThirdPunch=CONCAT_WS(' ',DATE(DATE_ADD(new.Recorddate,INTERVAL 1 DAY)),new.ThirdPunch);
END IF;
END IF;
IF(@overnight=1)THEN
	
SELECT TIMEDIFF(CONCAT_WS(' ',DATE(DATE_ADD(new.Recorddate,INTERVAL 1 DAY)),EndTime),CONCAT_WS(' ',DATE(new.Recorddate),TimeField)),shiftid,CONCAT_WS(' ',DATE(new.Recorddate),TimeField),CONCAT_WS(' ',DATE(DATE_ADD(new.Recorddate,INTERVAL 1 DAY)),EndTime) INTO @shifttime,@shiftid,@shiftstart,@shiftEnd FROM calcalendar WHERE employee=new.EmpID AND category=(SELECT Category_working  
FROM db_settings  LIMIT 1) AND DateField=new.Recorddate LIMIT 1;
SELECT TIMEDIFF(CONCAT_WS(' ',DATE(DATE_ADD(new.Recorddate,INTERVAL 1 DAY)),EndTime),CONCAT_WS(' ',DATE(new.Recorddate),TimeField))INTO @lunchtime FROM calcalendar WHERE employee=new.EmpID AND category=(SELECT Category_lunch  
FROM db_settings  LIMIT 1) AND DateField=new.Recorddate LIMIT 1;
SELECT 	Location INTO @location FROM employees WHERE employee_id=new.EmpID; 
	 
ELSE
	 
	 
SELECT TIMEDIFF(EndTime,TimeField),shiftid,CONCAT_WS(' ',DATE(new.Recorddate),TimeField) AS TimeField,CONCAT_WS(' ',DATE(new.Recorddate),EndTime) AS EndTime INTO @shifttime,@shiftid,@shiftstart,@shiftEnd FROM calcalendar WHERE employee=new.EmpID AND category=(SELECT Category_working  
FROM db_settings  LIMIT 1) AND DateField=new.Recorddate LIMIT 1;
SELECT TIMEDIFF(EndTime,TimeField)INTO @lunchtime FROM calcalendar WHERE employee=new.EmpID AND category=(SELECT Category_lunch  
FROM db_settings  LIMIT 1) AND DateField=new.Recorddate LIMIT 1;
SELECT 	Location INTO @location FROM employees WHERE employee_id=new.EmpID; 
 
	 
	 
END IF;
	 
	 
	
SELECT shiftname INTO @shiftname FROM shift_mast WHERE shiftid=@shiftid;
SET new.`TotalDurationInOffice-Actual`=TIMEDIFF(@FourthPunch,@FirstPunch);                                                                              
SET new.`DurationOfLunch-Actual`=TIMEDIFF(@ThirdPunch,@SecondPunch);                                                                                    
SET new.`TotalDurationInOffice-Expected`=@shifttime;
SET new.`DurationOfLunch-Expected`=@lunchtime;     
SET new.ShiftID=@shiftid;
SET new.ShiftName=@shiftname;  
SET new.Remarks=NULL;
SET new.expected_in_time=@shiftstart;  
SET new.expected_out_time=@shiftEnd;  
IF (TIMEDIFF(@FirstPunch,@shiftstart)>(SELECT late_in FROM late_early_details WHERE location=@location  LIMIT 1)) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "Late In");
	SET new.IsTardy=1;
END IF;
IF (TIMEDIFF(@shiftstart, @FirstPunch)>(SELECT early_in FROM late_early_details WHERE location=@location  LIMIT 1)) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "Early In");
END IF;
IF (TIMEDIFF(@shiftEnd,@FourthPunch)>(SELECT early_out FROM late_early_details WHERE location=@location  LIMIT 1)) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "Early Out");
	SET new.IsTardy=1;
END IF;
IF (TIMEDIFF(@FourthPunch,@shiftEnd)>(SELECT late_out FROM late_early_details WHERE location=@location  LIMIT 1)) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "Late Out");
END IF;   
IF (new.IsOnLeave=1 AND new.IsLeaveApproved=1) THEN
	
	SET new.Remarks=CONCAT("Leave(", new.LeaveDuration, ",Approved)");
	SET new.IsTardy=0;
ELSEIF (new.IsOnLeave=1 AND (new.IsLeaveApproved=0)) THEN
       
	SET new.Remarks=CONCAT("Leave(", new.LeaveDuration, ",UnApproved)");
	SET new.IsTardy=0;
