	(new.IsHoliday IS NULL OR new.IsHoliday <> 1 ) AND 
	(new.isweekoff IS NULL OR new.isweekoff <> 1 ) AND 
	(new.IsOnTour IS NULL OR new.IsOnTour <> 1 ) AND 
	((new.IsOnLeave IS NULL OR new.IsOnLeave <> 1 ) OR
(new.IsOnLeave=1 AND (new.IsLeaveApproved=0 OR new.IsLeaveApproved IS NULL)))
) THEN
	SET new.IsAbsent=1;
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "Absent");
END IF;
IF(new.IsHoliday = 1) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "Holiday");
END IF;
IF(new.isweekoff = 1) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "WeekOff");
END IF;
IF(new.IsOnTour = 1) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "OnTour");
END IF;
IF ((@FirstPunch IS NOT NULL AND @FourthPunch IS NULL) OR (@SecondPunch IS NOT NULL AND @ThirdPunch IS NULL)) THEN
	SET new.Remarks=CONCAT(IF(new.Remarks IS NULL,'',CONCAT(new.Remarks,',')), "Missing punch");
