--
-- Definition of trigger `nit_insert_attendancelogs`
--

DROP TRIGGER /*!50030 IF EXISTS */ `nit_insert_attendancelogs`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `nit_insert_attendancelogs` AFTER INSERT ON `nitgen_logs` FOR EACH ROW BEGIN   
    
   SET @nitgen_logs =  new.log;
   
   SET  @logdate =  DATE(SUBSTRING(new.log,2,10));
   
   SET  @logtime = SUBSTRING(new.log,13,8);
   
   SET  @left_string= SUBSTRING(new.log,22); 
   
   SET  @useid = SPLIT_STR(@left_string,'/',1);
   
   SET @equipment= SPLIT_STR(@left_string,'/',2);
   
   SET @signonthecard =  SPLIT_STR(@left_string,'/',3);
    
    IF (@signonthecard = 1) THEN 
    SET @signonthecard='Fingerprint';
    ELSEIF (@signonthecard = 2) THEN 
    SET @signonthecard='Fingerprint';
    ELSEIF (@signonthecard = 3) THEN 
    SET @signonthecard='Finger print and password';
    ELSEIF (@signonthecard = 4) THEN 
    SET @signonthecard='RF Card';
    ELSEIF (@signonthecard = 5) THEN 
     SET @signonthecard='Finger print and RF card';
   ELSEIF (@signonthecard = 6) THEN 
     SET @signonthecard='Password and RF Card';
   ELSEIF (@signonthecard = 7) THEN 
     SET @signonthecard='Fingerprint and Password and RF Card';
  ELSEIF (@signonthecard = 128) THEN 
     SET @signonthecard='Fingerprint (If 1:N authentication is used)';
   ELSEIF (@signonthecard = 131) THEN 
     SET @signonthecard='Fingerprint or password';
  ELSEIF (@signonthecard = 133) THEN 
     SET @signonthecard='Fingerprint or RF card';
  ELSEIF (@signonthecard = 134) THEN 
     SET @signonthecard='Password or RF card';
    END IF; 
    
     SET @logstatus =  SPLIT_STR(@left_string,'/',4);   
     
     
     
      SET @logonoffdutysign =  SPLIT_STR(@left_string,'/',5);    
      
      
	WorkID, 
	Recorddate, 
	Recordtime, 
	Signonthecard, 
	EquipmentID, 
	`STATUS`, 
	Remark, 
	onoffdutysign)
VALUES
(
@useid , 
@logdate, 
@logtime,
@signonthecard,
@equipment,
@logstatus,
NULL,
@logonoffdutysign 
);
	
   END $$

DELIMITER ;

