-- Definition of trigger `nitexcel_insert_attendancelogs`
--

DROP TRIGGER /*!50030 IF EXISTS */ `nitexcel_insert_attendancelogs`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `nitexcel_insert_attendancelogs` AFTER INSERT ON `nitgen_logs_excel` FOR EACH ROW BEGIN  
    
      IF  (new.Result = 'Success' )   THEN 
  SET  @logstatus=1; 
ELSE
    SET @logstatus=0;  
      END IF;    
      
   SELECT  DATE(CONCAT_WS('-',TRIM(SUBSTRING(new.`Event Time`,7,4)),TRIM(SUBSTRING(new.`Event Time`,4,2)), TRIM(SUBSTRING(new.`Event Time`,1,2))))  INTO @logdate;
  
   SELECT  TIME(CONCAT_WS(':',TRIM(SUBSTRING(new.`Event Time`,12,2)),TRIM(SUBSTRING(new.`Event Time`,15,2)),'00')) INTO   @logtime;
      
      IF (NOT new.`User ID` IS NULL )  THEN   
    
	WorkID, 
	Recorddate, 
	Recordtime, 
	Signonthecard, 
	EquipmentID, 
	`STATUS`, 
	Remark, 
	onoffdutysign)
VALUES
(
TRIM(new.`User ID`), 
@logdate,
@logtime,
TRIM(new.`Authentication Type`),
TRIM(new.`Terminal ID`),
@logstatus,
NULL,
TRIM(new.`FUNCTION KEY`) 
);
   END IF;  
   
   
  END $$

